window.bookSummaryJSON = "<p><b>Vice Admiral Nebs and his Archangels are coming for the Last Reaper, and they’re out for blood.</b></p> <p>Halek Cain and his crew jump into one slip tunnel after another to escape a psychopath with an armada of deadly warships. Every system is a trap; every encounter a potential battle.</p> <p>When Cain and his friends receive a distress call from the <i>Bold Freedom</i>, innocent lives will hang on their every decision. And Cain still has debts that need to be paid. People who helped him off the exploding prison station are going to die horribly if he doesn’t pull of the impossible.</p> <p>But they don’t call him the Last Reaper for nothing.</p>"; 
